import React from "react";
import TopLogo from "./TopLogo";
import Footer from "./Footer";
import SearchBar from "./SearchBar";
import MealItemsList from "./MealItemsList";

import mealImage from "../images/Burger_Fries.png"

const MealPage = () => {
  return(
    <div>
      Meal Page
      <Footer />
    </div>
  );
}

const displayInfo = [
  {
    title: "Meals",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Sides",
    image: mealImage,
    url: "/sides"
  },
  {
    title: "Drinks",
    image: mealImage,
    url: "/drinks"
  },
  {
    title: "Desserts",
    image: mealImage,
    url: "/desserts"
  }
];

export default MealPage;
